export function listSeasons(series: number) {
  return getSeries(series)?.seasons ?? [];
}

export function getSeries(index: number) {
  return listSeries().find((s) => s.index === index);
}

export function getSeason(series: number, index: number) {
  return getSeries(series)?.seasons?.find((s) => s.index === index);
}

export function listEpisodes(series: number, season: number) {
  return getSeason(series, season)?.episodes ?? [];
}

export function getEpisode(series: number, season: number, index: number) {
  return listEpisodes(series, season)?.find((s) => s.index === index);
}
